syntax = "proto3";

option java_package = "emu.grasscutter.net.proto";


// Name: OGPNHBOFECH
message HomeBlueprintBriefMuipData {
    string share_code = 1;
    uint32 owner_uid = 2;
    uint32 module_id = 3;
    uint32 scene_id = 4;
    uint32 block_id = 5;
    bool is_allow_copy = 6;
    uint32 create_time = 7;
}

